import {
  createContext,
  useContext
} from 'react';
const Sender = createContext();

const Header = ()=>{
  const userData = useContext(Sender);
  const design = (
    <h1>{userData.roll}</h1>
  );
  return design;
}

const Footer = ()=>{
  const design = (
    <h1>Footer</h1>
  );
  return design;
}

const Hooks = ()=>{
  const data = {
    name: 'aftab',
    roll: 3
  }
  const design = (
    <>
      <Sender.Provider value={data}>
        <Header/>
        <Footer/>
      </Sender.Provider>
    </>
  );
  return design;
}

export default Hooks;
